import { Box, Button, Highlight } from "@chakra-ui/react";

function AdminPage() {
  return (
    <Box h="100vh" w="100%" background="gray.100" display="flex" justifyContent="center" alignItems="center">
      <Button
        pos="absolute"
        top={30}
        right={30}
        padding="25px 20px"
        backgroundColor="#00AC97"
        color="white"
        fontWeight={700}
        _hover={{ bg: "rgba(0, 172, 151, 0.7)" }}
        borderRadius="25px"
        fontSize={16}
      >
        Создать ответ
      </Button>
      <Box display="flex" flexDir="column" alignItems="center" >
        <Box fontSize={16} fontWeight={700} color="#00AC97" >
          Добро пожаловать
        </Box>
        <Box
          fontSize={60}
          fontWeight={700}
          color="#14261C"
        >
          Выберите нужную вам опцию
        </Box>
      </Box>
    </Box>
  );
}

export default AdminPage;
